script: |
  super -f text -I q5632.spq | sort > q5632.out

inputs:
  - name: q5632.spq
    data: |
      SELECT DISTINCT - - col0 FROM tab2 (FORMAT parquet) WHERE NOT col1 * + - col2 + + + 10 + - col2 = + col0 * - + 75 * + + col1;
  - name: tab2

outputs:
  - name: q5632.out
    data: |
      46
      64
      75
